import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter,Route,Routes} from "react-router-dom";


function App() {
  return (
    <div className="App">
      <Navbar />

      <BrowserRouter>
        <Routes>
          <Route path='/'/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
